"policy_welcome": "Thank you for visiting Creative Cottage!  I strive to make each transaction the best it can be so if you have a question or concern please contact me and I will be happy to answer as soon as I can.",
"policy_payment": null,
"policy_shipping": "I am very diligent about keeping my shipping costs as low as I can.  I do not set the USPS prices, so my hands are tied on that one, but I do try to find the most cost efficient ways to ship my items and if I can get a substantially lower cost than my original postage quote I will refund you the difference.  \r\n\r\nI mail out twice a week, using the most economical mail service available. I try to only cover cost and do not charge a handling fee. \r\n\r\nAny customs fees are the responsibility of the buyer. I have absolutely no control over added duty/taxes.\r\n\r\nI am a new shop owner and trying to mail within the United States to start, however if you are an international customer send me a message with your location and I will get you an actual shipping price and adjust it to the item. \r\n\r\nIf you live nearby and would like to pick up your item, just drop me a note to arrange a pick up date/time and I will remove the shipping fees from the listing you are interested in.\r\n\r\nPlease note: I reuse packaging whenever possible. If you have concerns regarding this policy please make a note during checkout.",
"policy_refunds": "Please contact me immediately if you have any issues with your purchase. \r\n\r\nI am happy to rectify any errors made on my part and will gladly work with you to come to the best resolution in the unlikely event that any problems arise. If you have any problems or concerns please do not hesitate to contact me!\r\n\r\nBecause many of my items are OOAK I am unable to accept exchanges. However, if you are not happy with your purchase I will gladly provide a refund if the item is returned within 14 days (at buyers expense) in good and proper condition. \r\n\r\nIn the unlikely event that an item arrives damaged, please email me immediately so that a claim can be filed with the USPS as soon as possible. You will be asked to keep the package AND ALL PACKAGING until the claim has been processed. Once completed the package should be returned and your payment will be refunded. ",
"policy_additional": "Custom Orders\r\nI do accept custom orders, contact me if you have something you would like to have me create.  I will only accept the request if I feel it is within my realm of abilities and know that I can do your vision justice.  ",
