"title": "Gardening Gifts, Wedding Favors, Seed Bombs",
"announcement": "ATTENTION - Most new orders will not ship until 3-4 weeks or mid June. I will be away for a time. If you need a specific date, just convo me. I am happy to answer your questions. We welcome Custom orders!  We offer garden gifts, 1 inch Seed balls with organic seeds, 1.4 inch hearts, 2 inch seeded hearts, Wedding favors, Seed bombs of different shapes like Acorn, Leaf, flowers, buttons. Renaissance Botanical has an array of wedding favors in tulle, Burlap, organza, paper. We also love our feathered friends and create Bird Seed Cakes as well as natural pet products. See http://botanicalnotes.com/possibilities/  for wedding favor ideas. Our items come from a smoke free, pet free home/studio. Journal at renaissancebotanical.com.\r\nFor all natural perfumes and body products, see our shop wildperfume.etsy.com",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": null,
"sale_message": "Hello. Thank you so much for supporting handmade, we appreciate you purchasing from our little shop :)  You will receive a shipping notice  via email from Etsy, containing your shipping info. We make everything fresh and package well. International shoppers - you may be responsible for customs fees and or VAT based on the purchase price of your item. Please check with your Customs agency if you are unsure of these fees. \r\n\r\nAs always we hope that you like what you receive, and we&#39;re always available to hear your comments or questions. If there are any hiccups with your order, please contact me through Etsy conversation right away. \r\n\r\nWarm Regards,\r\n\r\nRenaissanceBotanical.com\r\n\r\n",
"digital_sale_message": null,
"last_updated_tsz": 1432588728,
"listing_active_count": 80,
"login_name": "StoneandFlower",
"accepts_custom_requests": true,
"policy_welcome": "Welcome to Renaissance Botanical.  We hope you enjoy viewing our wedding favors, seed bombs, seed hearts, bird seed cakes and organic bath and body products. Visit our website too. \r\nSeed bombs are about 1 inch for the balls, hearts are about 1.6 inches. \r\n\r\nwww.renaissancebotanical.com/possibilities\r\n\r\n ",
"policy_payment": "For payment, we accept Paypal and payments through Etsy.\r\n",
"policy_shipping": "We ship First Class with tracking to USA or it&#39;s over the 16 ounce local limit then usually send Priority unless otherwise stated. International goes 1st class or ground for liquid and small packets. Larger flat rates go Priority International. \r\n\r\nFor All Orders, domestic or International worth $249.99 or more, Signature Confirmation is required.\r\n\r\nWe always insure.\r\n",
"policy_refunds": " If you need to cancel, please let us know within 3 hours of purchase as we do have to mark time for production. \r\n\r\nCustom orders may not be resale-able, therefore non refundable, so be sure of design before ordering and be sure to order weeks in advance to arrive in time. I do not guarantee delivery by a certain date as USPS does not off a guarantee. Mishaps can happen and that is why I always purchase insurance.  \r\n\r\nPLEASE verify your shipping information before paying. We will resend or replace of course providing the package is returned to us or it has been the allotted time for insurance. \r\n\r\nPlease open your package right away and notify me within 24 hours of receipt if damaged or amiss.  We will pay the return shipping if it is our fault or if the Post has damaged the item, we will apply an insurance claim with the Post Office.\r\n\r\n",
"policy_additional": "With your purchase, you agree to assist with insurance claims. We also ask that you put the recipients address in before making payment if you are gifting.\r\n\r\nBE AWARE that on International shipments from here (U.S.A.) there may be CUSTOMS OR DUTY fees applied by your Country. Unfortunately we have no control over this. We cannot ship seeds above 500 g to Canada or international which is generally around 200 seed bombs. Check with your Country if you can import seed bombs for personal use.\r\nOur products, particularly the seed bombs are not meant for children without adult supervision and not meant for pets to play with. Though all natural, they can cause issues. NOT for ingestion.\r\n ",
"policy_seller_info": "We can always be reached via the convo system.\r\nWe try to describe all items completely but if you have issue, please notify us before leaving feedback so that we can work out the issues. \r\n\r\nThank you for stopping by our shop. ",
