"description": "PACKAGE INCLUDES: \n\n5 Sago Palm (Cycas) Seeds \n\n\n○ GROWING METHOD \n\nStep 1 \n\nFill a gallon-sized pot with soilless potting mix to within an inch of the pot&#39;s brim. \n\nStep 2 \n\nClean the seed if it was not harvested immediately prior to you planting it. Using a knife, cut into the fibrous husk that covers the seed and peel it off to reveal the smooth seed inside. \n\nStep 3 \n\nBury the seed in the soilless potting mix to a depth so that its top surface is just barely visible. \n\nStep 4 \n\nWater the pot twice a day or as necessary to keep the top couple of inches of potting mix moist. \n\nStep 5 \n\nPlace the pot in a brightly lit area that is out of direct sunlight. For the best germination rates, maintain a temperature around the pot of 25-27°C (80-85°F). The areca palm will typically germinate within two to six weeks. \n\nNB: If not planting your seeds straight away. It is recommended that they are cleaned by peeling off their outer husk, then putting them in a breathable bag at a temperature of 20-22°C (73°F) for up to 12 months.",
