"title": "Dwarf Lychee (Litchi chinensis) Tree SEEDS: The Best Kept Ancient Chinese Secret",
"description": "Dwarf Lychee (Litchi chinensis) Tree SEEDS: The Best Kept Ancient Chinese Secret\n\nThis Self Pollinating Lychee has a lush, dark green foliage that adds great contrast to the Lychee (or litchi) fruits that hang in bunches like giant, rose colored grapes.  The tree is admired both for its tempting fruit as well as the tree’s distinctive visual appeal.  If your imagination came up with its own fruit with the perfect flavor, it would be the Lychee.  It’s no wonder many Asian restaurants serve them sometimes accompanied by ice cream after a satisfying meal.  A rugged outer skin flakes away easily revealing the delicate, velvety fruit that waits beneath the skin.  Bite into the moist, sweet flesh and experience the rush of exotic flavor unique to the Lychee fruit.  \n\nSo different in taste, the Lychee’s white, somewhat translucent flesh almost defies description.  Some say the taste is like combining the flavors of pear, grape and coconut milk all in one fruit.  Lychees are easy to prepare and taste delicious when eaten chilled.  \n \nLychees are very good for you. Seven lychees have as much vitamin C as a small orange which is 100 per cent of the recommended daily intake of vitamin C!\n\n- Pack of 5 seeds –",
