"title": "RARE Dwarf Longan “Sri Chompoo” aka Dragon Eye Exotic Fruit SEEDS in container",
"description": "RARE Dwarf Longan “Sri Chompoo” aka Dragon Eye Translucent Flesh Fruit SEEDS\n\n &quot;Dragon Eye&quot; is so named because it resembles an eyeball when its fruit is shelled (the black seed shows through the translucent flesh like a pupil/iris).\n\nLongan Sri Chompoo “Dimocarpus longan”, a very rare and highly sought after compact growing selection of longan sourced from Thailand. This makes the longan suitable for some backyard gardens limited in space. Grows to 3&#39; to 5&#39; in a container! Containers help save space in your garden by utilizing your patio or even balcony space!\n \nSome people don&#39;t like the lychee fruit, complaining that it is too sweet, but the longan fruit has just enough tartness and muskiness to make it more palatable. However, it is still sweet with a pleasant aroma. Longan has a translucent flesh that has grape-like texture. It is related to the lychee, and also similar in that it grows on trees in bunches.\n \nThe tree forms a dense, round or oblong canopy of evergreen foliage. The bark is rough and corky. Glossy, dark green leaflets grow in pairs on opposite sides of leaf stems. Each stem hold six to nine pairs of 6 to 8 inch leaflets. The oblong or lancet-shaped foliage is tough and leathery with wavy margins. Flowering occurs around March, and fruits ripen from July to September.\n \n*****Hardiness Zone 10 to 11*****\n– Pack of 5 seeds – “Germination instructions and growing Guide included in package”",
