"title": "Extremely Dwarf Musa “Truly Tiny” Edible Banana Tree Seeds–Indoor Outdoor Plant",
"description": "Extremely Dwarf Musa “Truly Tiny” Edible Banana (Musa acuminata) Tree Seeds – Indoor Outdoor Plant    \n\nThis extremely Dwarf Musa “Truly Tiny” species grows vigorously and produce small fruit similar to Dwarf Cavendish. Forget about huge banana plants that need a lot of room. This unique Extreme Dwarf allows for growing inside the home, on the porch, or on a patio. It has a very symmetrical and compact appearance.\n\nHowever, the plant &quot;Truly Tiny&quot; do not exhibit characteristics completely consistent with the Dwarf Cavendish. The maximum height for this variety is between 24 and 30 inches, which makes “Truly Tiny” the shortest banana species.\n\nDue to its compactness, Musa “Truly Tiny” is ideally suited as a houseplant and as a tropical accent in the garden or container. This is very similar to the Dwarf Cavendish but much shorter. Its sweet bananas are also smaller than that of the Cavendish. “Truly Tiny” is an extremely dwarf banana tree, selected for its compact size and thick foliage. \n\n*****Hardiness Zone 7 to 10*****\n\n– Pack of 5 seeds – “Germination instructions included in package”\nThese seeds are guaranteed viable. Should you have difficulties with the germination, than just contact me for a free replacement.",
