"sale_message": "Thank you for your order! \r\nAll items are made to order, I will let you know once your purchase shipped.\r\nPlease contact me with any questions at michel.kg22@gmail.com\r\n\r\nBest regards,\r\nMichal Keren Gelman\r\nFree Folding",
