"description": "Flower planter, garden flower pot, wood, tabletop size, for indoor or outdoor flowers and plants:  &quot;Pyramid&quot;\n\nCedar tabletop planter for indoor/outdoor...\n\nMultiple levels for multiple flower types...\n\n12 x 12 x 10 inch high dimensions.    Weight:  4 pounds.\n\n3 separate compartments on 3 levels to plant ...\n\nAttractive 3 Tiered, 3 compartment design ...\n\nFirst tier is 6 inches tall.... Second Tier is 8 inches tall... Third Tier is 10 inches tall...\n\nNOTE:  The last 3 photos is the actual unit shipped... the size got DEEPER and taller !!\n\n============================================\n\nFill up with soil and plants :  this planter is silicone sealed to keep the water in... \n\n“Pyramid”  also makes a pretty cool Mini Rock Garden… or Mini Zen Garden ...\n.\nCedar wood :  Constructed of water proof & rot resistant wood... \n\nSeparate planting compartments :  mix and match your flowers and plants... \n\n=================================================\n\nFastened together with pilot holed 6 X 1 ¼ inch wood screws for integrity.  Limited glues....\n\nOrbital and Hand sanded to give smooth finish....\n\nCustom sizes available upon request.   “Scale-able” :  any size is available …\n\nGive your plants a stylish home to live in !\n\nDIMENSIONAL TOLERANCES:\nFinal dimensions may vary + / - 0.50 inches maximum due to wood supply stock variances.\nIf you need an EXACT dimension, please let me know.\n\nCOLOR AND WOOD GRAIN VARIANCE:\nYour final product may not appear exactly as shown in the photograph.  Each wood piece is different, each wood grain varies, and the color of stain or paint may not appear exactly as shown on your computer.\n\nWebsite : www.redcedarwoodcraft.com\n\nE-mail: sales (at) redcedarwoodcraft.com\nPhone: 310-740-6172\nwww.redcedarwoodcraft.com\n\n============================================================================================================================\nRed Cedar Woodcraft’s designs are Patent Pending. All RCW original designs are protected under U.S. patent law; offenders will be sought out and notified for pending legal action.",
