"title": "Unique Wood Planters, Cool Wood Frames, and Wood Art ",
"announcement": "Red Cedar Woodcraft is a craft woodshop dedicated to unique style wood planters, wood frames, and wood art.     Our website is www.RedCedarWoodcraft.com....\r\n\r\nWe strive to blend art and function.  We wish for our Wood planters, vases and frames to be stand alone art items that can sit on a table and look cool.  If you decide to add some flowers or photos, then it gets even better.\r\n\r\nWe specialize in custom sized planter...you really cannot find many people who build custom work these days !    Many of our wood planters are “compartmental&quot; and &quot;sectional” :  ones that have divided planting spaces.  \r\n\r\nSome of our larger planters are “separate & sectional”:  they have multiple separate individual planter parts that can be stacked together to form a larger planter piece.  We designed these for townhouse and condo dwellers that have limited space on their outdoor balconies.  \r\n\r\nOur wooden art and photo frames are of unique design.  We believe that the art frame should be a work of art itself... you remove the photo, and the frame can stand alone as a piece of wood art.   \r\n\r\nWe&#39;ve recently gotten into &quot;art pieces&quot;... the sculptures and wall hangings are a recent development.   The Name Shelves have been a nice addition also... popular for childrens&#39; rooms.\r\n\r\nWe&#39;ll keep designing.  You keep buying.\r\n\r\nEnjoy. \r\n\r\n",
"currency_code": "USD",
