"title": "Round Terrarium - Woodland Themed ~ Yellow Snail & Mushroom",
"description": "This adorable hanging terrarium is sure to make you smile not only because it&#39;s so sweet but because there is NO watering required and it&#39;s pretty much maintenance free!\n\nI love terrariums  but my customers would tell me that as much as they loved them they didn&#39;t like watering, keeping them clean and maintaining the plants.   So I decided to start making DRY Terrariums.  All the color and green of regular terrariums but instead I use preserved mosses and silk flowers.  I add my polymer clay miniatures to make them a bit magical and the result is a truly unique little glass world.  They are my number one seller at shows because they are delicate and adorable at the same time!\n\nDETAILS-\n\nThis Terrarium features an adorable little yellow snail with a white and blue shell.  He is sitting next to a yellow and mint green mushroom with green and natural moss and white floral touches surrounding him.  The scene is mounted on a birch wood cutting from New Hampshire.\n\nEach terrarium is handmade by me, using only my designs and imagination.\n\nAll the clay figures are handmade by me.\n\nI create the tiny worlds outside of the terrarium and like a &quot;ship-in-a-bottle&quot; I carefully place them inside.  \n\nEach scene is a ONE OF A KIND because each sculpture and scene develops organically. \n\nTerrarium is a 4&quot; round glass bubble terrarium and only weighs 7oz  (another plus to dry terrariums) \n\nIt will easily hang from a window, ceiling or whatnot quite easily by threading some twine or ribbon through the top hole. \n\nThis scene is glued in place so it will stay in the position seen in the photo.\n\nCARE:\n\nWhen you receive your terrarium, remove the protective packaging inside and simply blow into the terrarium.  This should clear any moss or debris that has settled due to shipping.\n\nDO NOT TRY TO TAKE SCENE OUT, \n\nTake glass cleaner and wipe the outside and inside if desired.  You find fingerprints on them regularly as people love to pick them up and look inside.\n\nNO WATERING\n\nNO Pruning\n\nEnjoy looking at your little scene!\n\nNotes:\n\nThese terrariums delight kids, however they are not designed as toys or intended for children.  The glass will break if dropped. \n\nIf you are a local customer you may contact me BEFORE you check out and I will remove shipping charge.\n\nI mail first class mail, if you would like to have it shipped priority the charge is $7.15 for shipping and I will need to change that before you purchase.  Just send me a conversation and I&#39;ll be happy to update for you.",
