"policy_welcome": "Welcome to Renaissance Botanical.  We hope you enjoy viewing our wedding favors, seed bombs, seed hearts, bird seed cakes and organic bath and body products. Visit our website too. \r\nSeed bombs are about 1 inch for the balls, hearts are about 1.6 inches. \r\n\r\nwww.renaissancebotanical.com/possibilities\r\n\r\n ",
"policy_payment": "For payment, we accept Paypal and payments through Etsy.\r\n",
