"policy_refunds": " If you need to cancel, please let us know within 3 hours of purchase as we do have to mark time for production. \r\n\r\nCustom orders may not be resale-able, therefore non refundable, so be sure of design before ordering and be sure to order weeks in advance to arrive in time. I do not guarantee delivery by a certain date as USPS does not off a guarantee. Mishaps can happen and that is why I always purchase insurance.  \r\n\r\nPLEASE verify your shipping information before paying. We will resend or replace of course providing the package is returned to us or it has been the allotted time for insurance. \r\n\r\nPlease open your package right away and notify me within 24 hours of receipt if damaged or amiss.  We will pay the return shipping if it is our fault or if the Post has damaged the item, we will apply an insurance claim with the Post Office.\r\n\r\n",
