"title": "RARE and Unusual! Carica Papaya &quot;Khon Kaen&quot; dwarf tree plant seeds!",
"description": "An early and productive fruiter, Khon kaen has a dwarf tree form and is heat-tolerant. An excellent papaya for southern gardens or as a tropical container fruiting plant in the north. The dwarf tree starts to flower and set fruit within 8 months when the plant reaches 24&quot; tall !  Khon kaen is  self-fertile whose fruits often weigh 3-7 pounds. Four-pound fruits are more common for container grown plants. The oblong papaya is yellow-golden, very sweet and juicy when ripe. Rich in vitamins A, C and other nutrients, it also contains papain, an enzyme that aids in the digestion of protein. Harvest the fruit when the skin yields slightly to the touch and changes from green to completely gold. You&#39;ll notice a sweet, delicious aroma when it is fully ripe! Grow in full sun and well-drained soil.\n\n*****Hardiness Zone 8 and higher for outdoors*****\n\nFull sun, grows to 6&#39; in container, minimum temperature 50°F, blooms in spring.\n\nSEEDS are from a 100% Self-pollinating, hermaphrodite plant!\nGrow it inside in the winter and take it outside in the summer months!\n– Pack of 20 seeds –",
