"policy_payment": "Payment can be made through Paypal, a secure on-line payment system which is very easy to use. You may already have an account. If not, you don&#39;t need to sign up to use this service, and can pay directly through the site by credit card.\r\n\r\nNEW TO ETSY?: Here is a tutorial to help you through the checkout process http://www.etsy.com/help/article/339",
"policy_shipping": "I pack my items with great care. I use recycled boxes, and a special eco bubble wrap . I take great care to ensure items arrive safely. In the unlikely event that an item arrives damaged, I will replace the damaged item (see refund policy).  \r\nOrders are shipped by register mail post, a special  registered  air mail with a tracking code (please see specific processing time on each item information). Shipping from Israel usually take 3-4 weeks, delivery times are estimated, delay may occur by post, custom or holiday.\r\n\r\n\r\nIt is the buyer responsibility to pay any taxes that customs might claim.\r\n\r\nFor express shipping, please contact me prior to order, for a price quote and processing times.\r\n\r\nMADE TO ORDER items take a solid 3-4 weeks for delivery. Where I am at in my process when the order is placed along with how many out standing orders I have currently will determine how long you will wait. If you would like to know if your piece is on the list for the next round of pots please feel free to contact me. I work as fast as my hands can make while still producing quality work. I&#39;m a one woman show and I really appreciate your patience and understanding that handmade ceramics take time.",
"policy_refunds": "All items are hand made with lots of care and attention, please allow small imperfections due to the nature of handmade work.\r\nIt is very important to me that you are happy with your order,  if you are not satisfied with your purchase, you can return or exchange the item within 14 days of receiving the item. Items must be unused and in original condition and packaging. Shipping cost will not be returned, and it is the buyer&#39;s responsibility to pay for the return shipping costs.\r\n\r\n",
