"description": "Heirloom Certified Organic\nPeanut Seeds\n&quot;Carolina Black&quot;\nArachis hypogaea\n\nUp for purchase is a package containing apprx. 4 grams of our \nCertified Organic Heirloom Carolina Black Peanut Seeds! (Approximately 5-10 Seeds or 2-3 peanut pods)\n\nWhen you receive your peanut seed package from Rainbow Seeds, you’ll notice that we ship them still in their shells.\n This is done to ensure seed protection and preservation. \nBefore you plant your peanuts, the seeds (the nuts) will need to be removed from their shells. \n\nPeanuts are a super fun and easy plant to grow for the whole family! \nOur kids just LOVE pulling all those nuts from the ground every fall!\nPeanuts are a great addition to a home garden since they require minimal care and provide bountiful yields.\nIf you&#39;ve never grown peanuts before, try these first. This heirloom variety grows well in \nmost soil types and is also early to harvest.\n\nCarolina Black (AKA African Peanut) is a rare 1800&#39;s heirloom black-skinned peanut from N. Carolina.\n&#39;Carolina Black&#39; produces wonderfully sweet tasting, black-skinned peanuts that are slightly larger than &#39;Spanish&#39; peanuts.\nThis is a beautiful bush type plant that produces high yields of black skinned peanuts.\nThis easy to grow variety grows well in many different soil types.\n\nAverages 2-3 peanuts per shell.\nPlant Height: 18&quot; tall.\nBotanical Name: Arachis hypogaea\n\nDuration: Annual\n\nDays to Maturity: 120 Days\n\nPlant Height: 9 in to 12 in\n\nSeed Depth: 1-2 inches deep\n\nSeed Spacing: 6-10 inches\n\nSun or Shade: Part to full sun\n\nPlanting tips: Add a layer of organic compost and mulch use the plants have begun growing to add a nutrient boost and to help keep weeds down.",
